import logo from './logo.svg';
import './App.css';
const axios = require('axios');


function App() {
  const data = {
    laanebeløp: 2000000,
    nominellRente: 3,
    terminGebyr: 30,
    utløpsDato: "2045-01-01",
    saldoDato: "2020-01-01",
    datoForsteInnbetaling: "2020-02-01",
    ukjentVerdi: "TERMINBELØP"
  }

  const options = {
    method: 'POST',
    url: 'https://visningsrom.stacc.com/dd_server_laaneberegning/rest/laaneberegning/v1/nedbetalingsplan',
    headers: { 'Content-type': 'application/json' },
    data: {
      laanebeløp: 2000000,
      nominellRente: 3,
      terminGebyr: 30,
      utløpsDato: "2045-01-01",
      saldoDato: "2020-01-01",
      datoForsteInnbetaling: "2020-02-01",
      ukjentVerdi: "TERMINBELØP"
    }
  }

  axios.post('', data, options).then(function (response) {
    console.log(response);
  })
    .catch(function (error) {
      console.log(error);
    });




  return (
    <div className="App">

      <a>HEI</a>

    </div>
  );
}

export default App;
